import React from "react";
import Modal from "react-modal";

const ModalDelete = () => {
  return (
    <React.Fragment>
      <Modal
        isOpen={modalOpen}
        onRequestClose={modalClose}
        className="modal-background"
        overlayClassName="modal-overlay"
      >
        <div></div>
      </Modal>
    </React.Fragment>
  );
};

export default ModalDelete;
